INSERT INTO Profil_Artiste VALUES(1, 'Queen', 'Queen are a British rock band formed in London in 1970 by Freddie Mercury (lead vocals, piano), Brian May (guitar, vocals), and Roger Taylor (drums, vocals), later joined by John Deacon (bass).', 'Profil_Groupe', NULL, 'Royaume-Uni');
INSERT INTO Profil_Artiste VALUES(2, 'Freddie Mercury', 'Freddie Mercury (1946-1991) was a British singer and songwriter who achieved worldwide fame as the lead vocalist and pianist of the rock band Queen.', 'Profil_Artiste_Solo', 1, 'Royaume-Uni');
INSERT INTO Profil_Artiste VALUES(3, 'Brian May', 'Brian May (1947) is a British musician, singer, songwriter and astrophysicist, co-founder and guitarist of the rock band Queen.', 'Profil_Artiste_Solo', 1, 'Royaume-Uni');
INSERT INTO Profil_Artiste VALUES(4, 'Roger Taylor', 'Roger Taylor (1949)is a British musician and singer-songwriter, best known for his prolific career with the band Queen as drummer.', 'Profil_Artiste_Solo', 1, 'Royaume-Uni');
INSERT INTO Profil_Artiste VALUES(5, 'Hayilat', 'Hayliat is a composer and musician who has worked on the soundtracks of many internationally renowned films.', 'Profil_Artiste_Solo', NULL, 'France');
INSERT INTO Profil_Artiste VALUES(6, 'PNL', 'PNL (Peace N’ Lovés) is a French rap duo consisting of siblings Ademo and N.O.S.', 'Profil_Groupe', NULL, 'France');
INSERT INTO Profil_Artiste VALUES(7, 'Michael Jackson','Michael Joseph Jackson was an American singer, songwriter, and dancer. Dubbed the "King of Pop", he is regarded as one of the most significant cultural figures of the 20th century.', 'Profil_Artiste_Solo', NULL, 'États-Unis');
INSERT INTO Profil_Artiste VALUES(8, 'Daft Punk', 'Daft Punk was a French electronic music duo formed in Paris in 1993 by Guy-Manuel de Homem-Christo and Thomas Bangalter.', 'Profil_Groupe', NULL, 'France');
INSERT INTO Profil_Artiste VALUES(9, 'Thomas Bangalter', 'Thomas Bangalter is a French musician, record producer, and film director. He is best known as one half of the French electronic music duo Daft Punk.', 'Profil_Artiste_Solo', 8, 'France');
INSERT INTO Profil_Artiste VALUES(10, 'Arctic Monkeys', 'Arctic Monkeys are an English rock band formed in Sheffield in 2002. The group consists of Alex Turner, Jamie Cook, Nick O''Malley, and Matt Helders.', 'Profil_Groupe', NULL, 'Royaume-Uni');
INSERT INTO Profil_Artiste VALUES(11, 'Elvis Presley', 'Elvis Aaron Presley was an American singer and actor. Regarded as one of the most significant cultural icons of the 20th century, he is often referred to as the "King of Rock and Roll".', 'Profil_Artiste_Solo', NULL, 'États-Unis');
INSERT INTO Profil_Artiste VALUES(12, 'Bob Dylan', 'Bob Dylan is an American singer-songwriter, author, and visual artist.', 'Profil_Artiste_Solo', NULL, 'États-Unis');
INSERT INTO Profil_Artiste VALUES(13, 'Madonna', 'Madonna Louise Ciccone is an American singer, songwriter, and actress. Referred to as the "Queen of Pop", she is regarded as one of the most influential figures in popular culture.', 'Profil_Artiste_Solo', NULL, 'États-Unis');
INSERT INTO Profil_Artiste VALUES(14, 'Mozart', 'Wolfgang Amadeus Mozart (1756 – 1791) was a prolific and influential composer of the Classical period.', 'Profil_Artiste_Solo', NULL, 'Autriche');
INSERT INTO Profil_Artiste VALUES(15, 'Chopin', 'Frédéric François Chopin (1810 – 1849) was a Polish composer and virtuoso pianist of the Romantic period, who wrote primarily for solo piano.', 'Profil_Artiste_Solo', NULL, 'Pologne');
INSERT INTO Profil_Artiste VALUES(16, 'David Bowie', 'David Robert Jones (1947 – 2016), known professionally as David Bowie was an English singer, songwriter, musician, and actor.', 'Profil_Artiste_Solo', NULL, 'Royaume-Uni');
INSERT INTO Profil_Artiste VALUES(17, 'Stevie Wonder', 'Stevland Hardaway Morris (1950), known professionally as Stevie Wonder, is an American singer-songwriter, musician, and record producer. He is credited as a pioneer and influence by musicians across a range of genres that include R&B, pop, soul, gospel, funk, and jazz.', 'Profil_Artiste_Solo', NULL, 'États-Unis');
INSERT INTO Profil_Artiste VALUES(18, 'Prince', 'Prince Rogers Nelson (1958 – 2016) was an American singer, multi-instrumentalist, songwriter, record producer, and actor.', 'Profil_Artiste_Solo', NULL, 'États-Unis');
INSERT INTO Profil_Artiste VALUES(19, 'Louis Armstrong', 'Louis Daniel Armstrong (1901 – 1971), nicknamed "Satchmo", "Satch", and "Pops", was an American trumpeter and vocalist.', 'Profil_Artiste_Solo', NULL, 'États-Unis');
INSERT INTO Profil_Artiste VALUES(20, 'Tupac Shakur', 'Tupac Amaru Shakur born Lesane Parish Crooks (1971 – 1996) was an American rapper and songwriter.', 'Profil_Artiste_Solo', NULL, 'États-Unis');
INSERT INTO Profil_Artiste VALUES(21, 'Beyoncé', 'Beyoncé Giselle Knowles-Carter (1981) is an American singer, songwriter and businesswoman.', 'Profil_Artiste_Solo', NULL, 'États-Unis');
INSERT INTO Profil_Artiste VALUES(22, 'Calvin Harris', 'Adam Richard Wiles (1984), known professionally as Calvin Harris, is a Scottish DJ, singer, songwriter, and record producer.', 'Profil_Artiste_Solo', NULL, 'Royaume-Uni');
INSERT INTO Profil_Artiste VALUES(23, 'Rahzel', 'Rozell Manely Brown (1964) is an American beatboxer and rapper.', 'Profil_Artiste_Solo', NULL, 'États-Unis');
INSERT INTO Profil_Artiste VALUES(24, 'Johnny Cash', 'John R. Cash (1932 – 2003) was an American country singer-songwriter.', 'Profil_Artiste_Solo', NULL, 'États-Unis');
INSERT INTO Profil_Artiste VALUES(25, 'Chief Keef', 'Keith Farrelle Cozart (1995),better known by his stage name Chief Keef, is an American rapper, singer, songwriter, and record producer.', 'Profil_Artiste_Solo', NULL, 'États-Unis');
INSERT INTO Profil_Artiste VALUES(26, 'Mac DeMarco', 'MacBriare Samuel Lanyon DeMarco (1990) is a Canadian singer, songwriter, multi-instrumentalist and producer.', 'Profil_Artiste_Solo', NULL, 'Canada');
INSERT INTO Profil_Artiste VALUES(27, 'Eminem', 'Marshall Bruce Mathers III (1972), known professionally as Eminem, is an American rapper.', 'Profil_Artiste_Solo', NULL, 'États-Unis');
INSERT INTO Profil_Artiste VALUES(28, 'The Beatles', 'The Beatles were an English rock band formed in Liverpool in 1960, comprising John Lennon, Paul McCartney, George Harrison and Ringo Starr.', 'Profil_Groupe', NULL, 'Royaume-Uni');
INSERT INTO Profil_Artiste VALUES(29, 'John Lennon', 'John Lennon was an English musician, singer, and songwriter who co-founded the Beatles, the most commercially successful band in the history of popular music.', 'Profil_Artiste_Solo', 28, 'Royaume-Uni');
INSERT INTO Profil_Artiste VALUES(30, 'Paul McCartney', 'Paul McCartney is an English musician, singer, and songwriter. He gained worldwide fame as the bass guitarist and singer for the rock band the Beatles.', 'Profil_Artiste_Solo', 28, 'Royaume-Uni');